import React, {useEffect, useState} from "react"
import axios from "axios"
function Vercuentas() {
    const token="eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyOTI5NGJkZTc0NDAwMTAxZWFhNDE4ZiIsImlhdCI6MTY1NDY5MDExOSwiZXhwIjoxNjU0Nzc2NTE5fQ.8AL24NLdgNYl8En1K_MWlUsfO7Y9bS3-bMjEPaViek0"
    const [cuentas, setCuentas] = useState([])
    const [cuenta, setCuenta] = useState([])

    useEffect(()=>{
        axios.get("/cuentas",{ headers: {"x-access-token" : `${token}`} })
        .then(response => setCuentas(response.data))
        .catch(error => console.log(error))
    },[])

    
      
    return <div>Hola</div>
    
  
}

export default Vercuentas
